import React, { useState, useEffect } from "react";
import styled from 'styled-components'
import CallMadeIcon from '@material-ui/icons/CallMade';
import img1 from '../Images/1.jpeg';
import img2 from '../Images/2.jpeg';
import img3 from '../Images/3.jpeg';
import FiberManualRecordIcon from '@material-ui/icons/FiberManualRecord';
import AttachFileIcon from '@material-ui/icons/AttachFile';

const Landing = () => {
  return (
    <Container>
        <h2 className="colorme">‚ù§Ô∏è</h2>
        <h2>Exactly four months ago, I visited the Pattern Drive office for the first time, purely out of fun, and it turned out to be one of the best decisions of my life.</h2>
        <div className="image">
            <div className="top-holder"><AttachFileIcon/></div>
            <img src={img1} alt="" />
            <div className="desc">Kitni pyaari lag rahi thi jaan, love at first sight wala pyaar ho jaya üòò</div>
        </div>
        <h2>Haan dosto ke samne rizz smash kar diya tha 2 sec mai room se bahar nikal ke but koi na cute mila tha ek. Uss din first time tera woo mera pasand wala smile dikha tha aur woo pyara sa eyes pe eyeliner.</h2>
        <div className="image oppo">
            <div className="top-holder"><AttachFileIcon/></div>
            <img src={img2} alt="" />
            <div className="desc">"Can I ask you few questions?"</div>
        </div>
        <h2>South city gaya dosto ke sath, naam pucha woo ladki ka naam kya tha - Priya bola woo log. Kisiko bhi tera account nhi mila, fir maine raat ko account dhunda from linkedin üòÇ</h2>
        <div className="image">
            <div className="top-holder"><AttachFileIcon/></div>
            <img src="https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcSx-2oOuGwA0-czHP_E4aKsFQCBJrF6eeFFFA&s" alt="" />
            <div className="desc">Kitni pyaari lag rahi thi jaan, love at first sight wala pyaar ho jaya üòò</div>
        </div>
        <h2>Pata laga itna sundar naam hai tera - Riya ‚ù§Ô∏è - Insta profile mila exactly 01:01 ko raat ko, aur 3 mins mai gayab lol!</h2>
        <div className="image oppo">
            <div className="top-holder"><AttachFileIcon/></div>
            <img src="https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcSx-2oOuGwA0-czHP_E4aKsFQCBJrF6eeFFFA&s" alt="" />
            <div className="desc">Kitni pyaari lag rahi thi jaan, love at first sight wala pyaar ho jaya üòò</div>
        </div>
        <h2>Ab smjh nhi aa raha itni jaldi meri itni pyari ladki ke sath 4 month kaise beet gaya ü•∫ü•πüíì</h2>
        <div className="image">
            <div className="top-holder"><AttachFileIcon/></div>
            <img src="https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcSx-2oOuGwA0-czHP_E4aKsFQCBJrF6eeFFFA&s" alt="" />
            <div className="desc">Kitni pyaari lag rahi thi jaan, love at first sight wala pyaar ho jaya üòò</div>
        </div>
        <div className="image oppo">
            <div className="top-holder"><AttachFileIcon/></div>
            <img src="https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcSx-2oOuGwA0-czHP_E4aKsFQCBJrF6eeFFFA&s" alt="" />
            <div className="desc">Kitni pyaari lag rahi thi jaan, love at first sight wala pyaar ho jaya üòò</div>
        </div>
        <div className="image">
            <div className="top-holder"><AttachFileIcon/></div>
            <img src="https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcSx-2oOuGwA0-czHP_E4aKsFQCBJrF6eeFFFA&s" alt="" />
            <div className="desc">Kitni pyaari lag rahi thi jaan, love at first sight wala pyaar ho jaya üòò</div>
        </div>
        <div className="image oppo">
            <div className="top-holder"><AttachFileIcon/></div>
            <img src="https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcSx-2oOuGwA0-czHP_E4aKsFQCBJrF6eeFFFA&s" alt="" />
            <div className="desc">Kitni pyaari lag rahi thi jaan, love at first sight wala pyaar ho jaya üòò</div>
        </div>
        <h2 className="colorme">I love you so much meri jaan ‚ù£Ô∏è</h2>
    </Container>
  )
}

export default Landing

const Container = styled.div`
    background-color: #222121;
    min-height: 100vh;
    width: 100%;
    max-width: 500px;
    padding: 50px;

    // background: url('https://w0.peakpx.com/wallpaper/189/297/HD-wallpaper-cute-butterfly-aesthetic.jpg') no-repeat center center;
    background-size: cover;

    display: flex;
    flex-direction: column;
    align-items: center;

    h2{
        font-weight: 600;
        font-size: 1.15rem;
        text-align: center;
        color: #ffffff; 
    }

    .image{
        position: relative;
        margin-top: 30px;
        margin-bottom: 30px;
        width: 90%;
        /* aspect-ratio: 1/1.25; */
        background-color: white;

        padding: 10px 10px 10px 10px;
        transform: rotate(2deg);

        .top-holder{
            position: absolute;
            /* width: 100%; */

            svg{
                font-size: 2.5rem;
                fill: black;
            }

            text-align: center;
            top: -20px;
            left: -10px;
            transform: rotate(40deg);
        }

        img{
            width: 100%;
        }

        .desc{
            font-size: 0.8rem;
        }
    }

    .oppo{
        transform: rotate(-2deg);   
    }

    .colorme{
        font-size: 1.5rem;
        color: #c4d1b0;
    }
`
